import React from 'react';

const ImageRecognition = ({ imageURL }) => {
  return (
    <div className='center ma'>
      <div className='absolute mt2'>
        <img style={{ marginBottom: '50px' }} alt='' src={imageURL} width='500px' height='auto' />
      </div>
      <div className='Tags'>
        <h2 className='f6 fw6 ttu tracked'>Tags</h2>
      </div>
    </div>
  );
}

export default ImageRecognition;
